import React from "react";
import styled from "styled-components";
const Card = ({ data, deleteCard }) => {
  const { item, calorie } = data;
  return (
    <StyledCard>
      <h1>{item}</h1>
      <h3>you have consumed {calorie} calories</h3>
      <Buttons>
        <Delete
          onClick={() => {
            deleteCard(item);
          }}
        >
          Remove
        </Delete>

        <Edit onClick={() => {}}>Edit</Edit>
      </Buttons>
    </StyledCard>
  );
};

export default Card;

const StyledCard = styled.div`
  border: 2px solid #39f;
  padding: 20px;
  margin-bottom: 10px;
`;

const Buttons = styled.div`
  padding: 10px;
  button {
    margin: 10px;
    cursor: pointer;
  }
`;

const Delete = styled.button`
  padding: 10px;
  border: none;
  background-color: #fd6e0d;
  color: #fff;
  font-size: 20x;
  border-radius: 4px;
`;

const Edit = styled.button`
  padding: 10px;
  border: none;
  background-color: #0d6efd;
  color: #fff;
  font-size: 20x;
  border-radius: 4px;
`;
